import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';
import { BrowserRouter } from 'react-router-dom'
import { Provider } from 'react-redux'
ReactDOM.render(
  <BrowserRouter>
    <Provider></Provider>
    < App />
  </BrowserRouter>
  , document.getElementById('root'));
